import React from 'react';
import {Card} from 'antd';

const { Meta } = Card;

import Booksrc from './../../../assets/Images/book.jpeg';


const Article = (props) => {
    return (
        <Card
        hoverable
        style={{ width: 240 }}
        cover={<img alt="example" src={Booksrc} />}
        >
        <Meta title="Europe Street beat" description="www.instagram.com" />
      </Card>
    );

}

export default Article;
